import React from "react";
import "./footer.styles.css";



function Footer(){
    return(

        <div className="footer">
            <a href="#" target='_blank'><img src="/media/twitter.jpg" alt="h" /></a>
            <a href="https://www.facebook.com/dimitris.apostolopoulos.7/" target='_blank'><img src="/media/facebook.jpg" alt="g" /></a>
            <a href="https://www.instagram.com/dim_ap/" target='_blank'><img src="/media/instagram.jpg" alt="f" /></a>
            <a href="https://www.linkedin.com/in/dimitris-apostolopoulos-9847a1172/" target='_blank'><img src="/media/twitter.jpg" alt="d" /></a>
            <a href="https://github.com/dimisap" target='_blank'><img src="/media/twitter.jpg" alt="s" /></a>
        </div>



    )
}


export default Footer;
